import React, {Component} from 'react';

class MovieCard extends Component{
    render(){
        if(this.props.movie.length > 0){

            return(
                <div className="movie-card" style={{ backgroundImage: `url(${this.props.movie[0].Poster})` }}>

                </div>
            );
        }else{
            return <div></div>
        }
    }
}

export default MovieCard;
